import React from 'react';
import logo from './images/logo.png';
import components from "./images/components.png";
import "./Header.css";


function Header() {
  return ( 
    


<div className = "Main" >

 <img className = "mainimage" src = {logo} alt = "logo" /> 

 <div className = "secondImage"> 
 
 <img className = "specs" src = {components} alt = "Loading!">  </img>
 
 </div>
 
 
 
 
 
</div>

 
 


  )

}

export default Header;
